import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/players.css';

function Players() {
  const [players, setPlayers] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const perPage = 15; // Adjusted number of players per page if necessary

  useEffect(() => {
    fetchPlayers();
  }, [currentPage]); // Dependency array fixed to re-fetch when currentPage changes

  const fetchPlayers = () => {
    fetch(`http://127.0.0.1:5000/players?page=${currentPage}`)
      .then(response => response.json())
      .then(data => {
        console.log('Fetched players:', data);
        setPlayers(data.players);  // Assuming the data is in { players: [] }
      })
      .catch(error => console.error('Error fetching players:', error));
  };

  // Function to handle page change
  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  // Calculate total number of pages
  const totalPages = Math.ceil(players.length / perPage);

  // Function to slice players for current page
  const slicePlayersForPage = () => {
    const startIndex = (currentPage - 1) * perPage;
    return players.slice(startIndex, startIndex + perPage);
  };

  return (
    <div className="players-container">
      <header className="header">
        <h1>Players Information</h1>
      </header>
      <div className="players-grid">
        {slicePlayersForPage().map((player, index) => (
          <div className="player-card card" key={index}>
            <img
              src={player.photo}
              className="card-img-top img-fluid"
              alt={player.name}
            />
            <div className="card-body">
              <h3 className="card-title">
                <Link to={`/player/${encodeURIComponent(player.name)}`} className="link-style">
                  {player.name}
                </Link>
              </h3>
              <p className="card-text"><b>Age:</b> {player.age}</p>
              <p className="card-text"><b>Number:</b> {player.number}</p>
              <p className="card-text"><b>Position:</b> {player.position}</p>
              <p className="card-text"><b>Club:</b>
                <Link to={`/club/${encodeURIComponent(player.club)}`} style={{ textDecoration: 'none' }}>
                  {player.club}
                </Link>
              </p>
            </div>
          </div>
        ))}
      </div>
      {/* Pagination logic simplified and corrected */}
      <div style={{ display: 'flex', justifyContent: 'center', marginTop: '20px' }}>
        <nav>
          <ul className="pagination">
            <li className={`page-item ${currentPage === 1 ? 'disabled' : ''}`}>
              <button className="page-link" onClick={() => handlePageChange(1)}>First</button>
            </li>
            <li className={`page-item ${currentPage === 1 ? 'disabled' : ''}`}>
              <button className="page-link" onClick={() => handlePageChange(currentPage - 1)}>Previous</button>
            </li>
            <li className={`page-item ${currentPage === totalPages ? 'disabled' : ''}`}>
              <button className="page-link" onClick={() => handlePageChange(currentPage + 1)}>Next</button>
            </li>
            <li className={`page-item ${currentPage === totalPages ? 'disabled' : ''}`}>
              <button className="page-link" onClick={() => handlePageChange(totalPages)}>Last</button>
            </li>
          </ul>
        </nav>
      </div>
    </div>
  );
}

export default Players;
